import React from "react";

import ArticleForm from 'components/ArticleForm'

const CreateArticle = () => {

    const errors = {};
    const initialValue = {}

    const onSubmit = data => {
        console.log('send data: ', data);
    }

    return (
        <div>
            <ArticleForm
                onSubmit={onSubmit}
                errors={errors}
                initialValue={initialValue}
            />
        </div>
    )
}

export default CreateArticle;
